/*
Given an integer array nums,
return all the different possible non-decreasing subsequences of
the given array with at least two elements.
You may return the answer in any order.



Example 1:
Input: nums = [4,6,7,7]
Output: [[4,6],[4,6,7],[4,6,7,7],[4,7],[4,7,7],[6,7],[6,7,7],[7,7]]

Example 2
Input: nums = [4,4,3,2,1]
Output: [[4,4]]

*/

func findSubsequences(nums []int) [][]int {
	result := [][]int{}
	var comb func(int, []int)
	comb = func(start int, nowcomb []int) {
		if len(nowcomb) > 1 {
			dst := make([]int, len(nowcomb))
			copy(dst, nowcomb)
			result = append(result, dst)
		}
		vis := map[int]bool{}
		for i := start; i < len(nums); i++ {
			// if i != start && nums[i] == nums[i-1] {
			// 	continue
			// }
			if start > 0 && nums[i] < nums[start-1] || vis[nums[i]] {
				continue
			}
			vis[nums[i]] = true
			nowcomb = append(nowcomb, nums[i])
			comb(i+1, nowcomb)
			nowcomb = nowcomb[:len(nowcomb)-1]

		}
	}
	comb(0, []int{})
	return result
}

